import { Text, View } from "react-native";
import { TextInput, Button } from "react-native-paper";
import AsyncStorage from "@react-native-async-storage/async-storage";
import { useState } from "react";
import { styles } from "../assets/styles/styles";

export default function CarScreen({ navigation }) {
  

  return (
    <View style={[styles.container]}>
      <Text style={{fontFamily:'Arial',fontSize:30,marginTop:10}}>Ingresar Carro</Text>
      <TextInput
        style={styles.texinput}
        activeOutlineColor="#0265FE"
        outlineColor="#919191"
        label="Nro Placa"
        mode="outlined"
        onChangeText={(plateNumber) => setPlateNumber(plateNumber)}
        value={plateNumber}
      />
      <TextInput
        style={styles.texinput}
        activeOutlineColor="#0265FE"
        outlineColor="#919191"
        label="Marca"
        mode="outlined"
        onChangeText={(brand) => setBrand(brand)}
        value={brand}
      />
      <TextInput
        style={styles.texinput}
        activeOutlineColor="#0265FE"
        outlineColor="#919191"
        label="Estado"
        mode="outlined"
        editable={false}
        value={state =='' ? 'Disponible': state}
      />
      <View style={[{flexDirection: "row", marginTop:20}]}>
        <Button
          style={{ marginTop: 10, marginEnd: 10 }}
          icon='share'
          mode="contained"
          buttonColor="#0265FE"
          onPress={saveCar}
        >Guardar</Button>
        <Button
          style={{ marginTop: 10 }}
          icon='repeat'
          mode="contained"
          buttonColor="#0265FE"
          onPress={searchCar}
        >Listar</Button>
      </View>
      <Button  
      style={{ marginTop: 10 }}
      textColor="#0265FE" 
      onPress={Limpiar}
      >Limpiar</Button>
      <Button
          style={{marginTop:10}}
          textColor="#0265FE"
          onPress={()=>{
            navigation.navigate('Profile')
          }}
      >Volver</Button>
      <Text style={{fontFamily:'Arial',fontSize:15,marginTop:20,color:'red'}}>{errorMess}</Text>
    </View>
  );
}
